<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8"/>
    <link rel="stylesheet" href="css/bootstrap.min.css" />
</head>
<body>
    <nav class="navbar navbar-default">
        <div class="navbar-header">
            <a class="navbar-brand">Sublime Text API Documentation for Dash</a>
        </div>
    </nav>
    <div class="container">
        <h1 id="name">class name</h1>
        <div class="class-version">
            <p>
                <span class="class-version-label"></span>
                <span class="class-doc"></span>
            </p>
            <br>
            <br>
        </div>
        <div class="method">
            <a class="dashAnchor"></a>
            <h2>
                <span class="method-name">method name</span>
                <span class="versions-label">ST*</span>
            </h2>
            <div class="version">
                <div class="well">
                    <span class="version-label">ST*</span>
                    <code class="method-syntax">method syntax</code>
                    <code># => </code>
                    <code class="returns">returns</code>
                </div>
                <p class="doc">doc</p>
                <br>
                <br>
            </div>
        </div>
        <hr>
        <p><small>Generated from the <a href="http://www.sublimetext.com/docs/3/index.html">official documentation</a> on <span class="generation-date"></span> by <a href="http://leonid.shevtsov.me">Leonid Shevtsov</a>.</span></small></p>
    </div>
</body>
</html>
